// const links = cities.links.map(d => Object.create(d));
// const nodes = cities.nodes.map(d => Object.create(d));
var links = cities.links.map(d => Object.create(d));
var nodes = cities.nodes.map(function(d){
    d.x = d.long;
    d.y = d.lat;
    return(Object.create(d));
});

const div_id = '#add-viz';
const div_height = d3.select(div_id).node().getBoundingClientRect().height,
      div_width = d3.select(div_id).node().getBoundingClientRect().width;

const svg = d3.select(div_id)
        .append('svg:svg')
            .attr('width', div_width)
            .attr('height', div_height);

const western_states = ["CA","NV","AZ","ID","OR","WA","MT","UT","WY"];

const col_scale = d3.scaleOrdinal(d3.schemeCategory10)
    .domain(western_states);

// Set the behavior that happens when the user drags a point
drag = simulation => {
  
  function dragstarted(event, d) {
    if (!event.active) simulation.alphaTarget(0.3).restart();
    d.fx = d.x;
    d.fy = d.y;
  }
  
  function dragged(event,d) {
    d.fx = event.x;
    d.fy = event.y;
  }
  
  function dragended(event,d) {
    if (!event.active) simulation.alphaTarget(0);
    d.fx = null;
    d.fy = null;
  }
  
  return d3.drag()
      .on("start", dragstarted)
      .on("drag", dragged)
      .on("end", dragended);
}

// Define the actual force simulation
const simulation = d3.forceSimulation(nodes)
    .force("charge", d3.forceManyBody())
    .force(
        "link", 
        d3.forceLink(links)
            .id(d => d.id)
            .distance(d => 25 / d.value)
        )
    .force("center", d3.forceCenter(div_width / 2 + 50, div_height / 2))
    .force("x", d3.forceX())
    .force("y", d3.forceY());

// Visualize links between nodes
const link = svg.append('g')
        .attr('stroke', '#999')
        .attr('stroke-opacity', 0.6)
    .selectAll('line')
    .data(links)
    .join("line")
        .attr('stroke-width', d => d.value / 2);

// Visualize nodes as circles
const node = svg.append('g')
        .attr('stroke', '#ddd')
        .attr('stroke-width', 1.5)
    .selectAll('circle')
    .data(nodes)
    .join("circle")
        .attr('r', d => Math.pow(d.weight_viz / 5E5, 1/4))
        .attr('fill', d => col_scale(d.state))
        .call(drag(simulation));

// Update points over time
simulation.on("tick", () => {
    link
        .attr("x1", d => d.source.x)
        .attr("y1", d => d.source.y)
        .attr("x2", d => d.target.x)
        .attr("y2", d => d.target.y);

    node
        .attr("cx", d => d.x)
        .attr("cy", d => d.y);
});

// Add a legend
const legend_text_size = 20;
const legend_gap = 5;

svg.append('rect')
    .attr('x', 0)
    .attr('y', 0)
    .attr('width', legend_text_size * 2.5)
    .attr('height', (legend_text_size + legend_gap) * western_states.length)
    .attr('fill', 'white')
    .attr('opacity', 0.7);

var legend = svg
    .selectAll('text')
    .data(western_states.sort())
    .join('text')
        .style('font', 'bold ' + legend_text_size + 'px sans-serif')
        .attr('x', 5)
        .attr('y', d => 20 + (legend_text_size+legend_gap) * western_states.indexOf(d))
        .text(d => d)
        .attr('fill', d => col_scale(d));
